import React from 'react'
import Header from './Header';
import Cards from './Cards';
import Tabels from './Tabels';
import Footer from './Footer';

export default function Home() {
  return (
    <>
    <div className='min-w-full h-auto bg-slate-200'>
      <Header/>
      <Cards/>
      <Tabels/>
      <Footer/>
    </div>
    </>
  )
}
